import React, { useEffect } from "react";
import signalRService from "../services/signalRService";

const TerminalComponent = () => {
  useEffect(() => {
   const startSignalRConnection = async () => signalRService.startConnection();
  }, []);

  // Handle flightReceived event
  signalRService.addFlightReceivedListener((flight) => {
    console.log("Received flight:", flight);
    // Process the received flight data
  });

  // Handle flightRemove event
  signalRService.addFlightRemoveListener((flight) => {
    console.log("Removed flight:", flight);
    // Process the removed flight data
  });

  // Handle flightMove event
  signalRService.addFlightMoveListener((flight) => {
    console.log("Moved flight:", flight);
    // Process the moved flight data
  });

  return <div>
    <div>
        
    </div>
  </div>;
};

export default TerminalComponent;
